public class Test {
    public boolean isUnique(String astr) {
        Set<Character> set = new HashSet<>();
        for (int i = 0; i < astr.length(); i++) {
            char c = astr.charAt(i);
            if (set.contains(c)) {
                return false;
            }
            set.add(c);
        }
        return true;
    }


    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> result = new ArrayList<>();

        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < p.length(); i++) {
            char pChar = p.charAt(i);
            if (map.containsKey(pChar)) {
                map.put(pChar, map.get(pChar) + 1);
            } else {
                map.put(pChar, 1);
            }
        }
        int pLength = p.length();

        Map<Character, Integer> tmpMap = new HashMap<>();
        for (int i = 0; i < p.length(); i++) {
            char sChar = s.charAt(i);
            if (tmpMap.containsKey(sChar)) {
                tmpMap.put(sChar, tmpMap.get(sChar) + 1);
            } else {
                tmpMap.put(sChar, 1);
            }
        }
        if (isMapEmpty(map, tmpMap)) {
            result.add(0);
        }

        for (int i = 1; i < s.length() - p.length() + 1; i++) {
            char leftChar = s.charAt(i - 1);
            char rightChar = s.charAt(i + p.length() - 1);

            tmpMap.put(leftChar, tmpMap.get(leftChar) - 1);

            if (tmpMap.containsKey(rightChar)) {
                tmpMap.put(rightChar, tmpMap.get(rightChar) + 1);
            } else {
                tmpMap.put(rightChar, 1);
            }
            if (isMapEmpty(map, tmpMap)) {
                result.add(i);
            }

        }
        return result;
    }

    public boolean isMapEmpty(Map<Character, Integer> map, Map<Character, Integer> map2) {
        for (Map.Entry<Character, Integer> entry : map.entrySet()) {
            if (!Objects.equals(map2.get(entry.getKey()), entry.getValue())) {
                return false;
            }
        }
        return true;
    }


    public static void main(String[] args) {
        String s = "";
        String p = "";

        List<Integer> result = new Test().findAnagrams(s, p);
        for (Integer i : result) {
            System.out.println(i + " ");
        }
    }
}
